import React from 'react';

class MainHeader extends React.Component{
    render(){
        return (
            <div>
                <h1 style={{display: 'flex',  justifyContent:'center', alignItems:'center'}}>
                NFL Score Tracker
                </h1>
            </div>
        )
    }
}



export default MainHeader;
